import React from 'react';
import "./arrow.css"

function handleScroll(e) {
    e.preventDefault();
    window.scroll({
        top:  document.body.scrollDown=820,
        behavior: 'smooth',
    });
}
const Arrow = () => {
    return (
        <div  className="arrow"  onClick={handleScroll}/>
    );
};

export default Arrow;
